<!DOCTYPE html>
<html xmlns:th="http://www.thymeleaf.org">

<head>
    <meta charset="utf-8">

    <meta name="description" content="Profile">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1, shrink-to-fit=no, user-scalable=no, minimal-ui">
    <!-- Call App Mode on ios devices -->
    <meta name="apple-mobile-web-app-capable" content="yes" />
    <!-- Remove Tap Highlight on Windows Phone IE -->
    <meta name="msapplication-tap-highlight" content="no">
    <link rel="stylesheet" media="screen, print" th:href="@{/css/vendors.bundle.css}">
    <link rel="stylesheet" media="screen, print" th:href="@{/css/app.bundle.css}">
    <!-- Place favicon.ico in the root directory -->
    <link rel=" apple-touch-icon " sizes="180x180 " th:href="@{/img/favicon/apple-touch-icon.png}">
    <link rel="icon " type="image/png " sizes="32x32 " th:href="@{/img/favicon/favicon-32x32.png}">
    <link rel="mask-icon" th:href="@{/img/favicon/safari-pinned-tab.svg}" color="#5bbad5">

    <!-- Optional: page related CSS-->
    <link rel="stylesheet " media="screen, print " th:href="@{/css/fa-brands.css}">
    <link rel="stylesheet " media="screen, print " th:href="@{/css/fa-solid.css}">

</head>

<body class="desktop chrome webkit pace-done blur">
    <div class="pace  pace-inactive">
        <div class="pace-progress" data-progress-text="100%" data-progress="99" style="transform: translate3d(100%, 0px, 0px);">
            <div class="pace-progress-inner"></div>
        </div>
        <div class="pace-activity"></div>
    </div>
    <div class="page-wrapper alt">
        <main id="js-page-content" role="main" class="page-content">
            <div class="h-alt-f d-flex flex-column align-items-center justify-content-center text-center">
                <h1 class="page-error color-fusion-500">
                    Información
                    <small class="fw-500">
                                  Trámite ó servicio no encontrado 
                              </small>
                </h1>
                <h3 class="fw-500 mb-5">
                    El trámite o servicio no se encontró, o esta temporalmente fuera de línea.
                </h3>
                <h4>
                    Disculpe las molestias que esto pueda causarle.
                </h4>
                <a href="/p/consulta">Regresar a trámites y servicios</a>
            </div>
        </main>

    </div>


</body>

</html>
